Sharing my current healthy-ish favorite snacks. If you are looking for better alternatives here’s my go to: 

@thejollyllamaco caramel chocolate chip cone (so delicious esp if I’m craving chocolate cone)

@latejulyorganic Jalapeno lime (if I’m craving Doritos blue ranch, this is the closest one tasting like Doritos 🤣)

@yumearth giggles (when I’m wanting skittles but without the food coloring)

@crunchmastercrackers oatmeal minis (I love having these with my yogurt, it’s just enough sweetness 🥰)

And if you are gluten free and dairy free these are yummy. 

